{"data_series_issue_identification_fra": "2013", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Cruise Report - Arctic Prowler, Teleglobe Canada Survey For Tat-9", "data_series_issue_identification": "2013", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Commission g\u00e9ologique du Canada, Dossier public", "spatial_representation_type": "Document Digital | Document num\u00e9rique", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "R\u00e9sum\u00e9 non disponible. \n\nLa s\u00e9rie des dossiers publics vise \u00e0 acc\u00e9l\u00e9rer la diffusion de l'information en rendant publics des manuscrits non r\u00e9vis\u00e9s qui feront l\u2019objet d\u2019une publication officielle, ainsi qu\u2019\u00e0 pr\u00e9senter les donn\u00e9es compl\u00e9mentaires pertinentes qui sont mentionn\u00e9es dans des rapports publi\u00e9s.\n\nLes dossiers publics peuvent prendre les formes suivantes : cartes, rapports, volumineux ensembles de donn\u00e9es provenant de lev\u00e9s g\u00e9ophysiques \u00e0 param\u00e8tres multiples et de lev\u00e9s g\u00e9ochimiques, rapports de consultants, ainsi que les r\u00e9sultats provisoires et non v\u00e9rifi\u00e9s de travaux r\u00e9alis\u00e9s sur le terrain et en laboratoire.\n\nLes dossiers publics font l'objet d\u2019un examen critique par un sp\u00e9cialiste. Ils s\u2019adressent \u00e0 des sp\u00e9cialistes (industrie mini\u00e8re, am\u00e9nagement du territoire, \u00e9tudiants en sciences de la Terre) plut\u00f4t qu\u2019au grand public.", "presentation_form": "Document Digital | Document num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-64.5000, 42.7500], [-64.5000, 44.5000], [-63.0000, 44.5000], [-63.0000, 42.7500], [-64.5000, 42.7500]]]}", "license_id": "", "resources": [{"url": "http://geoscan.ess.nrcan.gc.ca/cgi-bin/starfinder/0?path=geoscan.fl&id=fastlink&pass=&format=FLFULL&search=R=130639", "language": "no language | aucune langue", "format": "GEOSCAN"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/ess_pubs/130/130639/of_2013.pdf", "language": "no language | aucune langue", "format": "PDF"}], "browse_graphic_url": "", "topic_category": "Geoscientific Information  Information g\u00e9oscientifique", "tags": [{"name": "earth sciences  sciences de la terre"}, {"name": "geophysics  g\u00e9ophysique"}, {"name": "geophysical surveys  lev\u00e9s g\u00e9ophysiques"}, {"name": "side-scan sonar  sonar lat\u00e9ral"}, {"name": "bottom sediments  s\u00e9diments de fond"}, {"name": "scour marks  marques daffouillement"}, {"name": "continental shelf  plate-forme continentale"}, {"name": "seafloor topography  topographie du fond oc\u00e9anique"}, {"name": "surficial geologygeomorphology  g\u00e9ologie des d\u00e9p\u00f4ts meublesg\u00e9omorphologie"}, {"name": "geophysics  g\u00e9ophysique"}, {"name": "Emerald Basin  Bassin dEmerald"}, {"name": "Lahave Bank  Plate-Forme de N\u00e9o-\u00e9cossaise"}, {"name": "Scotian Shelf  Scotian Shelf"}, {"name": "Eastern offshore region  R\u00e9gion extracoti\u00e8re de lest"}, {"name": "Scotian Shelf  Scotian Shelf"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1989-01-01", "time_period_coverage_start": "", "data_series_name": "Geological Survey of Canada, Open File", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "0000e36c-9131-5353-8438-fd07d1dc948d", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0000e36c-9131-5353-8438-fd07d1dc948d.html", "notes": "Abstract not available. \n\nThis series is produced to expedite the release of information by making unedited manuscript material available to the public in advance of formal publication, and to act as a repository for relevant supporting data that are referred to in published reports.\n\nOpen Files can be maps; reports; voluminous data sets resulting from multiparameter geophysical and geochemical surveys; consultants' reports; preliminary, unvetted field and laboratory results.\n\nThey are all critically reviewed by one specialist. The series is geared towards specialists (mining industry, land-use planning, geoscience students) rather than the general public.", "title": "Cruise Report - Arctic Prowler, Teleglobe Canada Survey For Tat-9", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0000e36c-9131-5353-8438-fd07d1dc948d.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "N78d54mW087d38m_4", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N78d54mW087d38m_4", "data_series_issue_identification": "N78d54mW087d38m_4", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[78.89736, -87.688209], [78.915905, -87.689346], [78.916108, -87.592905], [78.897563, -87.591927], [78.89736, -87.688209]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W087/N78/N78d54mW087d38m_4.gtif", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W087/N78/N78d54mW087d38m_4.tfw", "language": "no language | aucune langue", "format": "TIFF World File"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W087/N78/N78d54mW087d38m_4.tif", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W087/N78/N78d54mW087d38m_4.summary", "language": "no language | aucune langue", "format": "text"}], "browse_graphic_url": "", "topic_category": "Location  Localisation", "tags": [{"name": "Geomatics  G\u00e9omatique"}, {"name": "Geographic data  Donn\u00e9es g\u00e9ographiques"}, {"name": "Photography  Photographie"}, {"name": "Aerial photography  Photographie a\u00e9rienne"}, {"name": "Imagery and Basemaps  Imagerie et carte de base"}, {"name": "GCP  BDPC"}, {"name": "Air photo  Photo a\u00e9rienne"}, {"name": "Ground Control Points  Points dappui au sol"}, {"name": "NTS 49F13  SNRC 49F13"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1969-12-31", "time_period_coverage_start": "", "data_series_name": "Ground Control Database, Canada", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "000167ed-cc91-5071-9c8a-6e7151bc7aac", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/000167ed-cc91-5071-9c8a-6e7151bc7aac.html", "notes": "The Ground Control Database (GCDB) is a collection of geo-corrected aerial photo images (or chips) developed for the GIS and remote sensing community. The database provides accurate and useful information obtained from corrected aerial photos. This database can be used by the end-user as a fundamental data source for correction and validation of satellite, vector and raster data, as well as for map correcting and updating, analysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N78d54mW087d38m_4", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/000167ed-cc91-5071-9c8a-6e7151bc7aac.html", "organization": "nrcan-rncan", "department_number": ""}
