{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada - 066H", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada", "spatial_representation_type": "Model Digital | Mod\u00e8le num\u00e9rique", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Le Centre d'information topographique (CIT) produit les DNEC de concert avec des organismes f\u00e9d\u00e9raux, provinciaux et territoriaux ainsi qu'avec le secteur priv\u00e9.   Les DNEC consistent en un tableau ordonn\u00e9 de valeurs d'\u00e9l\u00e9vation au sol ou de surface (enregistr\u00e9es en m\u00e8tres) interpol\u00e9es \u00e0 des points r\u00e9guli\u00e8rement espac\u00e9s. Les donn\u00e9es sources num\u00e9riques des DNEC peuvent \u00eatre extraites des \u00e9l\u00e9ments hypsographiques et hydrographiques de la Base nationale de donn\u00e9es topographiques (BNDT) aux \u00e9chelles de 1/50 000 et 1/250 000, ou de la Base de donn\u00e9es g\u00e9ospatiales (BDG), ou de donn\u00e9es de position, \u00e0 diverses \u00e9chelles, acquises des provinces et territoires ou d'imageries de t\u00e9l\u00e9d\u00e9tection.", "presentation_form": "Model Digital | Mod\u00e8le num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-98, 65], [-98, 66], [-96, 66], [-96, 65], [-98, 65]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/250k_dem/066/066h.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/250k_dem/066/066h.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}], "browse_graphic_url": "", "topic_category": "Elevation  \u00c9l\u00e9vation", "tags": [{"name": "CDED066H1.0  DNEC066H1.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "066H  066H"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1987", "data_series_name": "Canadian Digital Elevation Data", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1987", "name": "0003870a-f301-434a-82f6-d736e2474b25", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0003870a-f301-434a-82f6-d736e2474b25.html", "notes": "The Centre for Topographic Information (CTI) jointly produces the CDED with federal, provincial and territorial government agencies as well as the private sector.   A CDED consists of an ordered array of ground or reflective surface elevations, recorded in metres, at regularly spaced intervals. The source digital data for CDED is extracted from the hypsographic and hydrographic elements of the National Topographic Data Base (NTDB) at scales of 1:50,000 and 1:250,000, or the Geospatial Data Base (GDB), or various scaled positional data acquired by the provinces and territories, or remotely sensed imagery.", "title": "Canadian Digital Elevation Data - 066H", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0003870a-f301-434a-82f6-d736e2474b25.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "3.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base nationale de donn\u00e9es topographiques (BNDT) - 053N01", "data_series_issue_identification": "3.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base nationale de donn\u00e9es topographiques (BNDT)", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Cette collection est maintenant statique. Les utilisateurs actuels de la Base nationale de donn\u00e9es topographiques (BNDT) devraient envisager de faire la transition vers le produit CanVec. La Base nationale de donn\u00e9es topographiques (BNDT) est compos\u00e9e de donn\u00e9es num\u00e9riques vectorielles qui couvrent l'ensemble du territoire canadien. En num\u00e9risant et en structurant des milliers de cartes topographiques, G\u00e9omatique Canada a con\u00e7u un produit homog\u00e8ne et complet, fort utile dans une multitude de secteurs d'activit\u00e9s. La BNDT comprend des \u00e9l\u00e9ments comme les cours d'eau, les zones urbaines, les r\u00e9seaux ferroviaire et routier, la v\u00e9g\u00e9tation et le relief. La BNDT utilise comme unit\u00e9 organisationnelle le d\u00e9coupage r\u00e9gulier du Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC), lui-m\u00eame bas\u00e9 sur le Syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1983 (NAD83). Chaque fichier (jeu de donn\u00e9es) repr\u00e9sente une unit\u00e9 du SNRC \u00e0 l'\u00e9chelle de 1/50 000. Les donn\u00e9es num\u00e9riques sont repr\u00e9sent\u00e9es par des points, des lignes et des surfaces.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[54.9999936, -92.00000677], [54.9999943, -92.25001466], [54.9999933, -92.50000207], [55.2499937, -92.50001501], [55.2499987, -92.25000254], [55.2499948, -92.00000096], [54.9999936, -92.00000677]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/053/n/bndt_053n01_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/053/n/bndt_053n01_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/053/n/bndt_053n01_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/053/n/bndt_053n01_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "NTDB053N011.2  BNDT053N011.2"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "Designated area  Aires d\u00e9sign\u00e9es"}, {"name": "Road  Chemin"}, {"name": "Manmade features  Constructions"}, {"name": "Relief and Landforms  Relief et formes"}, {"name": "Hydrography  Hydrographie"}, {"name": "Hypsography  Hypsographie"}, {"name": "ToponymyPlace Names  ToponymieNoms de lieux"}, {"name": "Electric Network  R\u00e9seau \u00e9lectrique"}, {"name": "Railroad Network  R\u00e9seau f\u00e9rroviaire"}, {"name": "Road Network  R\u00e9seau routier"}, {"name": "Water Saturated Soils  Sols satur\u00e9s deau"}, {"name": "Vegetation  V\u00e9g\u00e9tation"}, {"name": "053N01  053N01"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1973", "data_series_name": "National Topographic Data Base (NTDB)", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1986", "name": "0003913f-45d0-4204-8295-2d285f1438f8", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0003913f-45d0-4204-8295-2d285f1438f8.html", "notes": "This collection is static now. Current users of the National Topographic Data Base (NTDB) should plan to make the transition towards CanVec product. The National Topographic Data Base (NTDB) comprises digital vector data sets that cover the entire Canadian landmass. Geomatics Canada has digitized and structured thousands of topographic maps, creating a complete and uniform product that can be highly useful in a broad range of industries. The NTDB includes features such as watercourses, urban areas, railways, roads, vegetation, and relief.The organizational unit for the NTDB is the National Topographic System (NTS), based on the North American Datum of 1983 (NAD83). Each file (data set) consists of one NTS unit at the 1:50,000 scale. The ground data is depicted through points, lines, and areas.", "title": "National Topographic Data Base (NTDB) - 053N01", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0003913f-45d0-4204-8295-2d285f1438f8.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "GEOBASE_2.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada - 084M12", "data_series_issue_identification": "GEOBASE_2.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada", "spatial_representation_type": "Model Digital | Mod\u00e8le num\u00e9rique", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Le Centre d'information topographique (CIT) produit les DNEC de concert avec des organismes f\u00e9d\u00e9raux, provinciaux et territoriaux ainsi qu'avec le secteur priv\u00e9.   Les DNEC consistent en un tableau ordonn\u00e9 de valeurs d'\u00e9l\u00e9vation au sol ou de surface (enregistr\u00e9es en m\u00e8tres) interpol\u00e9es \u00e0 des points r\u00e9guli\u00e8rement espac\u00e9s. Les donn\u00e9es sources num\u00e9riques des DNEC peuvent \u00eatre extraites des \u00e9l\u00e9ments hypsographiques et hydrographiques de la Base nationale de donn\u00e9es topographiques (BNDT) aux \u00e9chelles de 1/50 000 et 1/250 000, ou de la Base de donn\u00e9es g\u00e9ospatiales (BDG), ou de donn\u00e9es de position, \u00e0 diverses \u00e9chelles, acquises des provinces et territoires ou d'imageries de t\u00e9l\u00e9d\u00e9tection.", "presentation_form": "Model Digital | Mod\u00e8le num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-120, 59.5], [-120, 59.75], [-119.5, 59.75], [-119.5, 59.5], [-120, 59.5]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/50k_dem/084/084m12.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/50k_dem/084/084m12.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}], "browse_graphic_url": "", "topic_category": "Elevation  \u00c9l\u00e9vation", "tags": [{"name": "CDED084M121.1  DNEC084M121.1"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "084M12  084M12"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1996-08-01", "data_series_name": "Canadian Digital Elevation Data", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1996-08-01", "name": "0003e681-a30a-4669-bd70-bc22c45af901", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0003e681-a30a-4669-bd70-bc22c45af901.html", "notes": "The Centre for Topographic Information (CTI) jointly produces the CDED with federal, provincial and territorial government agencies as well as the private sector.   A CDED consists of an ordered array of ground or reflective surface elevations, recorded in metres, at regularly spaced intervals. The source digital data for CDED is extracted from the hypsographic and hydrographic elements of the National Topographic Data Base (NTDB) at scales of 1:50,000 and 1:250,000, or the Geospatial Data Base (GDB), or various scaled positional data acquired by the provinces and territories, or remotely sensed imagery.", "title": "Canadian Digital Elevation Data - 084M12", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0003e681-a30a-4669-bd70-bc22c45af901.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Ortho-image Landsat 7 d\u00e9coup\u00e9e par SNRC au 1:50 000 - 023H11", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Ortho-image Landsat 7 d\u00e9coup\u00e9e par SNRC au 1:50 000", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Le produit CanImage est une image matricielle contenant de l'information provenant des ortho-images Landsat 7 r\u00e9\u00e9chantillonn\u00e9es et d\u00e9coup\u00e9es selon le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) \u00e0 l'\u00e9chelle de 1/50 000 dans la projection UTM. Ce produit est distribu\u00e9 par fichier dans le format GeoTIFF. La r\u00e9solution de ce produit est de 15 m\u00e8tres. Les ortho-images Landsat 7 contiennent 8 bandes spectrales. Pour la cr\u00e9ation du produit CanImage, les bandes 3 (rouge), 2 (verte) et 1 (verte-bleue) ont \u00e9t\u00e9 retenues. Ces bandes sont repr\u00e9sent\u00e9es par les couleurs rouge (bande 3), verte (bande 2) et bleue (bande 1). Un rehaussement lin\u00e9aire est effectu\u00e9 sur chacune des 3 bandes spectrales afin d'am\u00e9liorer le contraste des donn\u00e9es. Le d\u00e9coupage du produit selon le SNRC dans la projection UTM g\u00e9n\u00e8re un chevauchement entre les fichiers CanImage adjacents.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-65.5, 53.5], [-65.5, 53.75], [-65, 53.75], [-65, 53.5], [-65.5, 53.5]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canimage/50k/023/h/canimage_023h11_tif.zip", "language": "no language | aucune langue", "format": "GeoTIF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canimage/50k/023/h/canimage_023h11_tif.zip", "language": "no language | aucune langue", "format": "GeoTIF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANIMAGE023H111.0  CANIMAGE023H111.0"}, {"name": "Earth Science  Earth Science"}, {"name": "Sciences de la Terre  Sciences de la Terre"}, {"name": "National imagery  National imagery"}, {"name": "Imagerie nationale  Imagerie nationale"}, {"name": "WAY BAY  WAY BAY"}, {"name": "023H11  023H11"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "2002-10-12", "data_series_name": "Landsat 7 Orthoimage tiled by NTS 1/50000", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "2002-10-12", "name": "000463cb-4fc5-4970-9671-de4dfa46be59", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/000463cb-4fc5-4970-9671-de4dfa46be59.html", "notes": "CanImage is a raster image containing information from Landsat 7 orthoimages that have been resampled and based on the National Topographic System (NTS) at the 1:50 000 scale in the UTM projection. The product is distributed in files in GeoTIFF format. The resolution of this product is 15 metres. The Landsat 7 ortho images contain 8 spectral bands. For the creation of the CanImage product, the following bands were retained: band 3 (red), 2 (green) and 1 (green-blue). These bands are displayed using the colors: red (band 3), green (band 2) and blue (band 1). A linear stretching is done on each of the 3 band in order to increase the contrast. The clipping of the product according to the NTS in the UTM projection generate an overlap between the adjacent CanImage data sets.", "title": "Landsat 7 Orthoimage tiled by NTS 1/50000 - 023H11", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/000463cb-4fc5-4970-9671-de4dfa46be59.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "N65d11mW139d39m_3", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N65d11mW139d39m_3", "data_series_issue_identification": "N65d11mW139d39m_3", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[65.206314, -139.793927], [65.224882, -139.793081], [65.224521, -139.748824], [65.205953, -139.749701], [65.206314, -139.793927]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W139/N65/N65d11mW139d39m_3.gtif", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W139/N65/N65d11mW139d39m_3.tfw", "language": "no language | aucune langue", "format": "TIFF World File"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W139/N65/N65d11mW139d39m_3.tif", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W139/N65/N65d11mW139d39m_3.summary", "language": "no language | aucune langue", "format": "text"}], "browse_graphic_url": "", "topic_category": "Location  Localisation", "tags": [{"name": "Geomatics  G\u00e9omatique"}, {"name": "Geographic data  Donn\u00e9es g\u00e9ographiques"}, {"name": "Photography  Photographie"}, {"name": "Aerial photography  Photographie a\u00e9rienne"}, {"name": "Imagery and Basemaps  Imagerie et carte de base"}, {"name": "GCP  BDPC"}, {"name": "Air photo  Photo a\u00e9rienne"}, {"name": "Ground Control Points  Points dappui au sol"}, {"name": "NTS 116G4  SNRC 116G4"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1969-12-31", "time_period_coverage_start": "", "data_series_name": "Ground Control Database, Canada", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "0004a00f-fab2-539c-a192-53dfcefc3976", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0004a00f-fab2-539c-a192-53dfcefc3976.html", "notes": "The Ground Control Database (GCDB) is a collection of geo-corrected aerial photo images (or chips) developed for the GIS and remote sensing community. The database provides accurate and useful information obtained from corrected aerial photos. This database can be used by the end-user as a fundamental data source for correction and validation of satellite, vector and raster data, as well as for map correcting and updating, analysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N65d11mW139d39m_3", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0004a00f-fab2-539c-a192-53dfcefc3976.html", "organization": "nrcan-rncan", "department_number": ""}
