{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer - 014C03", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Les fichiers CanMatrix - Pr\u00eat \u00e0 imprimer ont \u00e9t\u00e9 produits \u00e0 partir des cartes topographiques publi\u00e9es par le Gouvernement du Canada. Ces fichiers sont bas\u00e9s sur le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) et disponibles aux \u00e9chelles de 1/50 000 et 1/250 000. Chaque fichier ou jeu de donn\u00e9es CanMatrix - Pr\u00eat \u00e0 imprimer contient l'ensemble de l'information figurant au recto de la carte topographique. Cela comprend l'information topographique incluse \u00e0 l'int\u00e9rieur de l'orle cartographique de m\u00eame que l'habillage de la carte, soit l'information situ\u00e9e en p\u00e9riph\u00e9rie de l'orle cartographique.  Les donn\u00e9es contenues dans ce fichier CanMatrix - Pr\u00eat \u00e0 imprimer proviennent du balayage d'une carte topographique papier polychrome (couleur).", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-61.5, 56], [-61.5, 56.25], [-61, 56.25], [-61, 56], [-61.5, 56]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/014/c/canmatrix2_014c03_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/014/c/canmatrix2_014c03_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/014/c/canmatrix2_014c03_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/014/c/canmatrix2_014c03_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANMATRIX2014C031.0  CANMATRIX2014C031.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "AKPIKTOK ISLAND  AKPIKTOK ISLAND"}, {"name": "014C03  014C03"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1962", "data_series_name": "CanMatrix - Print Ready", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1962", "name": "0005040d-e5eb-4a73-ae73-70864196fea2", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0005040d-e5eb-4a73-ae73-70864196fea2.html", "notes": "CanMatrix - Print Ready files were produced from topographic maps published by the Government of Canada, and correspond to the National Topographic System (NTS) grid at 1:50 000 and 1:250 000 scales. Each CanMatrix - Print Ready file or dataset contains all of the information shown on the front of the topographic map, including the topographic information within the neatline of the map, and the information in the border of the map outside of the neatline.  This CanMatrix - Print Ready file was produced by scanning a polychrome (colour) paper topographic map.", "title": "CanMatrix - Print Ready - 014C03", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0005040d-e5eb-4a73-ae73-70864196fea2.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "N72d05mW100d24m_1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N72d05mW100d24m_1", "data_series_issue_identification": "N72d05mW100d24m_1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[72.062955, -100.300148], [72.081507, -100.30145], [72.081896, -100.241768], [72.063343, -100.240527], [72.062955, -100.300148]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W100/N72/N72d05mW100d24m_1.gtif", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W100/N72/N72d05mW100d24m_1.tfw", "language": "no language | aucune langue", "format": "TIFF World File"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W100/N72/N72d05mW100d24m_1.tif", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W100/N72/N72d05mW100d24m_1.summary", "language": "no language | aucune langue", "format": "text"}], "browse_graphic_url": "", "topic_category": "Location  Localisation", "tags": [{"name": "Geomatics  G\u00e9omatique"}, {"name": "Geographic data  Donn\u00e9es g\u00e9ographiques"}, {"name": "Photography  Photographie"}, {"name": "Aerial photography  Photographie a\u00e9rienne"}, {"name": "Imagery and Basemaps  Imagerie et carte de base"}, {"name": "GCP  BDPC"}, {"name": "Air photo  Photo a\u00e9rienne"}, {"name": "Ground Control Points  Points dappui au sol"}, {"name": "NTS 68B1  SNRC 68B1"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1969-12-31", "time_period_coverage_start": "", "data_series_name": "Ground Control Database, Canada", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "000512d3-4eb3-52ec-86b3-7d4bb42cffcc", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/000512d3-4eb3-52ec-86b3-7d4bb42cffcc.html", "notes": "The Ground Control Database (GCDB) is a collection of geo-corrected aerial photo images (or chips) developed for the GIS and remote sensing community. The database provides accurate and useful information obtained from corrected aerial photos. This database can be used by the end-user as a fundamental data source for correction and validation of satellite, vector and raster data, as well as for map correcting and updating, analysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N72d05mW100d24m_1", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/000512d3-4eb3-52ec-86b3-7d4bb42cffcc.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "Cartes synth\u00e8ses quotidiennes de la couverture de neige et de glace continentale au Canada, 2007-12-02", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Cartes synth\u00e8ses quotidiennes de la couverture de neige et de glace continentale au Canada, 2007-12-02", "data_series_issue_identification": "Daily Canadian Snow and Inland Ice Cover Synthesis Maps, 2007-12-02", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Cartes synth\u00e8ses quotidiennes de la couverture de neige et de glace continentale au Canada", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Ce jeu de donn\u00e9es correspond \u00e0 la carte de couverture de neige et de glace produite un jour plus tard sur le territoire canadien et ses environs. La carte est produite en fusionnant trois cartes de la couverture de neige et de glace d\u00e9j\u00e0 valid\u00e9es fournies par la NOAA, la NASA et Ressources naturelles Canada. Ces cartes sont reconnues individuellement pour leur concordance avec les donn\u00e9es sur le parcours d'enneigement in-situ fournies par le Service m\u00e9t\u00e9orologique du Canada. En principe, on effectue la cartographie d'apr\u00e8s l'image composite MODIS quotidienne \u00e0 r\u00e9solution de 500 m de la couverture nivale. Cependant, les cartes \u00e0 r\u00e9solution 4 km de la NOAA sont utilis\u00e9es pour couvrir les vides dus \u00e0 la pr\u00e9sence de nuages dans l'image composite.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-175, 38], [-175, 90], [-54, 90], [-54, 38], [-175, 38]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/collections/snow_cover/2007/png/Blend_MOD10_500m_NOAA_snow_2007336.hdf.png.gz", "language": "no language | aucune langue", "format": "gzip (GNU zip)"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/collections/snow_cover/2007/raw/Blend_MOD10_500m_NOAA_snow_2007336.hdf.raw.gz", "language": "no language | aucune langue", "format": "gzip (GNU zip)"}], "browse_graphic_url": "", "topic_category": "Inland Waters  Eaux int\u00e9rieures", "tags": [{"name": "Ice  Glace"}, {"name": "Snow  Neige"}, {"name": "Inland Waters  Eaux int\u00e9rieures"}, {"name": "Oceans  Oc\u00e9an"}, {"name": "Inland water resources  Ressources en eaux int\u00e9rieures"}, {"name": "Oceans  Oc\u00e9an"}, {"name": "Coasts  Littoral"}, {"name": "Earth Sciences  Sciences de la Terre"}, {"name": "Cryosphere  Cryosph\u00e8re"}, {"name": "Snowice  Neigeglace"}, {"name": "Snow cover  Couverture de neige"}, {"name": "Snow depth  \u00c9paisseur de neige"}, {"name": "Lake ice  Glace lacustre"}, {"name": "Ice cover continental  Couverture de glace continentale"}, {"name": "Ice  Glace"}, {"name": "Alberta  Alberta"}, {"name": "British Columbia  Colombie-Britannique"}, {"name": "Manitoba  Manitoba"}, {"name": "New Brunswick  Nouveau-Brunswick"}, {"name": "Newfoundland and Labrador  Terre-Neuve-et-Labrador"}, {"name": "Northwest Territories  Territoires du Nord-Ouest"}, {"name": "Nova Scotia  Nouvelle-\u00c9cosse"}, {"name": "Nunavut  Nunavut"}, {"name": "Ontario  Ontario"}, {"name": "Prince Edward Island  \u00cele-du-Prince-\u00c9douard"}, {"name": "Qu\u00e9bec  Qu\u00e9bec"}, {"name": "Saskatchewan  Saskatchewan"}, {"name": "Yukon  Yukon"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2007-12-02", "time_period_coverage_start": "", "data_series_name": "Daily Canadian Snow and Inland Ice Cover Synthesis Maps", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "00056452-36c1-5e12-874b-6ea07780cdb3", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/00056452-36c1-5e12-874b-6ea07780cdb3.html", "notes": "This dataset corresponds to a next day map of snow and ice cover over Canada and its surrounding territories. The map is produced by blending three already validation snow and ice cover maps provided by NOAA, NASA and Natural Resources Canada. These maps have already been individually shown to have similar agreement with in-situ snow course data provided by the Meteorological Service of Canada. Nominally, the 500m resolution MODIS snow cover daily composite is mapped. However, NOAA 4km resolution maps are used to fill gaps due to the presence of clouds within that composite.", "title": "Daily Canadian Snow and Inland Ice Cover Synthesis Maps, 2007-12-02", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/00056452-36c1-5e12-874b-6ea07780cdb3.html", "organization": "nrcan-rncan", "department_number": ""}
