{"data_series_issue_identification_fra": "GEOBASE_2.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada - 045O10", "data_series_issue_identification": "GEOBASE_2.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada", "spatial_representation_type": "Model Digital | Mod\u00e8le num\u00e9rique", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Le Centre d'information topographique (CIT) produit les DNEC de concert avec des organismes f\u00e9d\u00e9raux, provinciaux et territoriaux ainsi qu'avec le secteur priv\u00e9.   Les DNEC consistent en un tableau ordonn\u00e9 de valeurs d'\u00e9l\u00e9vation au sol ou de surface (enregistr\u00e9es en m\u00e8tres) interpol\u00e9es \u00e0 des points r\u00e9guli\u00e8rement espac\u00e9s. Les donn\u00e9es sources num\u00e9riques des DNEC peuvent \u00eatre extraites des \u00e9l\u00e9ments hypsographiques et hydrographiques de la Base nationale de donn\u00e9es topographiques (BNDT) aux \u00e9chelles de 1/50 000 et 1/250 000, ou de la Base de donn\u00e9es g\u00e9ospatiales (BDG), ou de donn\u00e9es de position, \u00e0 diverses \u00e9chelles, acquises des provinces et territoires ou d'imageries de t\u00e9l\u00e9d\u00e9tection.", "presentation_form": "Model Digital | Mod\u00e8le num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-83, 63.5], [-83, 63.75], [-82.5, 63.75], [-82.5, 63.5], [-83, 63.5]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/50k_dem/045/045o10.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/50k_dem/045/045o10.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}], "browse_graphic_url": "", "topic_category": "Elevation  \u00c9l\u00e9vation", "tags": [{"name": "CDED045O101.0  DNEC045O101.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "045O10  045O10"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1978-08-07", "data_series_name": "Canadian Digital Elevation Data", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1978-08-07", "name": "0005d48a-97d7-4603-8ae5-87ee1fd46473", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0005d48a-97d7-4603-8ae5-87ee1fd46473.html", "notes": "The Centre for Topographic Information (CTI) jointly produces the CDED with federal, provincial and territorial government agencies as well as the private sector.   A CDED consists of an ordered array of ground or reflective surface elevations, recorded in metres, at regularly spaced intervals. The source digital data for CDED is extracted from the hypsographic and hydrographic elements of the National Topographic Data Base (NTDB) at scales of 1:50,000 and 1:250,000, or the Geospatial Data Base (GDB), or various scaled positional data acquired by the provinces and territories, or remotely sensed imagery.", "title": "Canadian Digital Elevation Data - 045O10", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0005d48a-97d7-4603-8ae5-87ee1fd46473.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "1,1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanMatrix - g\u00e9or\u00e9f\u00e9renc\u00e9 - 012L", "data_series_issue_identification": "1,1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanMatrix - g\u00e9or\u00e9f\u00e9renc\u00e9", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "Ce fichier CanMatrix (g\u00e9or\u00e9f\u00e9renc\u00e9) est un produit compos\u00e9 de donn\u00e9es matricielles r\u00e9sultant du balayage de la carte papier \u00e0 l'\u00e9chelle de 1/250 000. La source (carte papier) et le fichier matriciel r\u00e9sultant sont g\u00e9ocod\u00e9s dans le Syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1983 (NAD83) selon la projection Universelle transverse de Mercator (UTM). Le jeu de donn\u00e9es est disponible dans le format G\u00e9oTIFF.  Le Centre d'information topographique d\u00e9sire mettre en place l'\u00e9quivalent d'une base de donn\u00e9es nationale continue de cartes matricielles o\u00f9 chaque pixel poss\u00e8de une situation g\u00e9ographique distincte.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-64, 50], [-64, 51], [-62, 51], [-62, 50], [-64, 50]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix/250k_300dpi/012/l/canmatrix_012l_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix/250k_300dpi/012/l/canmatrix_012l_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANMATRIX012L1.1  CANMATRIX012L1.1"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "HAVRE-SAINT-PIERRE  HAVRE-SAINT-PIERRE"}, {"name": "012L  012L"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1995", "data_series_name": "CanMatrix - georeferenced", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1995", "name": "0005dd39-4f44-4416-ad3a-f5d1d3db03f6", "language": "", "url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/0005dd39-4f44-4416-ad3a-f5d1d3db03f6.html", "notes": "This CanMatrix (georeferenced) file is composed of raster data from the scanned map at the 1:250 000 scale. The source (paper map) and the resulting raster file is geocoded according to the North American Datum of 1983 (NAD83) according to the Universal Transverse Mercator (UTM) projection. This product is distributed in GeoTIFF.  The Centre for Topographic Information wants to create a national database composed of raster map data where each pixel has a distinct geographic location (georeferenced data).", "title": "CanMatrix - georeferenced - 012L", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/0005dd39-4f44-4416-ad3a-f5d1d3db03f6.html", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "N63d39mW120d46m_1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N63d39mW120d46m_1", "data_series_issue_identification": "N63d39mW120d46m_1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[63.591733, -120.777367], [63.610296, -120.775917], [63.609644, -120.734211], [63.591081, -120.735688], [63.591733, -120.777367]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery