ysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N63d39mW120d46m_1", "url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/00061972-1d7a-5439-8eac-86494425255b.html", "organization": "nrcan-rncan", "department_number": ""}
