{"data_series_issue_identification_fra": "1.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanTopo - 059E03", "data_series_issue_identification": "1.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanTopo", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "", "geographic_region": "", "notes_fra": "CanTopo est la nouvelle g\u00e9n\u00e9ration de cartes topographiques produites par Ressources naturelles Canada. Ce produit cartographique num\u00e9rique provient des meilleures sources de donn\u00e9es disponibles couvrant le territoire canadien et offre un produit cartographique de qualit\u00e9 en formats vectoriel et matriciel qui est conforme aux normes g\u00e9omatiques internationales.  CanTopo est un produit de sources multiples g\u00e9n\u00e9r\u00e9 \u00e0 partie de la Base de donn\u00e9es cartographique (BDC) d\u00e9crite dans les Sp\u00e9cifications de produit de la Base de donn\u00e9es cartographiques. Les donn\u00e9es de la BDC proviennent principalement de l'initiative G\u00e9oBase (www.geobase.ca), des donn\u00e9es topographiques num\u00e9riques de Ressources naturelles Canada et de donn\u00e9es d'initiatives nationales. Des donn\u00e9es de sources faisant autorit\u00e9 telles que provenant d'autres agences gouvernementales autant f\u00e9d\u00e9rales que provinciales, sont utilis\u00e9es entrepos\u00e9es et identifi\u00e9es.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-91, 78], [-91, 78.25], [-90, 78.25], [-90, 78], [-91, 78]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_pdf/059/e/cantopo_059e03_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_